<SettingsLayout>
  <Section title="Google Maps integration" isCollapsible="true" isCollapsed="false">
	  <UnencodedText>This gadget uses Google Maps APIs. For more information, see the 
	  &lt;a href=&quot;http://gethelp.wildapricot.com/en/articles/1601&quot; target=&quot;_blank&quot; &gt;gadget help page&lt;/a&gt;</UnencodedText>
	 <UnencodedText>1. Click &lt;b&gt;Get Started&lt;/b&gt; from the &lt;a href=&quot;https://cloud.google.com/maps-platform&quot; target=&quot;_blank&quot; &gt;Google Cloud Platform&lt;/a&gt;.</UnencodedText>
	  <UnencodedText>2. Create or sign into a Google account. You may be asked to enable billing for your account.</UnencodedText>
	  <UnencodedText>3. Create a new project or selecting an existing one.</UnencodedText>
	  <UnencodedText>4. After the API key is generated, do &lt;b&gt;not&lt;/b&gt; click &lt;b&gt;Done&lt;/b&gt; or copy the API key. Instead, click the &lt;b&gt;Credentials page&lt;/b&gt; link.</UnencodedText>
	  <UnencodedText>5. Within the &lt;b&gt;Application restrictions&lt;/b&gt; section, select the option to restrict this key's usage to &lt;b&gt;HTTP referrers&lt;/b&gt;.</UnencodedText>
  	  <UnencodedText>6. Under &lt;b&gt;Website restrictions&lt;/b&gt;, add your Wild Apricot domain name(s).</UnencodedText>	  
	  <UnencodedText>7. Click &lt;b&gt;Save&lt;/b&gt;.</UnencodedText>
	  <UnencodedText>8. Copy the API key that appears and paste it in the field below.</UnencodedText>
	  <Control settingName="jsKey" title="Google Maps API key" /> 
  	  <UnencodedText>9. Click &lt;b&gt;Done&lt;/b&gt;.</UnencodedText>
	  <Text>Note: It may take up to 5 minutes for your settings to take effect</Text>
	  <UnencodedText>To control API key usage in the future, go to your &lt;a href=&quot;https://console.cloud.google.com/apis/&quot; target=&quot;_blank&quot; &gt;Google Platform Dashboard&lt;/a&gt;</UnencodedText>
  </Section>

  <Section title="General">
	  <Control settingName="members" />
      <Control settingName="showBundleAdministratorOnly" />
	  <Text>Whether a member appears on the map depends on their privacy settings and their status (must be Active or Pending Renewal)</Text>
  </Section>
  
  <Section title="Member address fields">
	  <UnencodedText>&lt;div style=&quot;color:#2e2e2e;font-size:12px;&quot; &gt;You have to choose at least one field from your contact and member fields (below). If you choose only one field, it should be a country field or include the country (e.g. address).&lt;/div&gt;</UnencodedText>	  
	  <Control settingName="address" />
  </Section>
  
  <Section title="Pop-Up window">
	  <UnencodedText>
		&lt;div style=&quot;color:#2e2e2e;font-size:12px;&quot; &gt;
			Customize pop-up window &lt;img src=&quot;data:image/svg+xml;base64,&quot; 
			align=&quot;right&quot; width=&quot;110&quot; height=&quot;60&quot; /&gt;
		&lt;/div&gt;
	  </UnencodedText>
	  <Control settingName="info" />
  </Section>
  
  <Section title="Display map options">
	<Control settingName="Height" title="Height:" titlePosition="left" titleWidth="55" postfix="px" />    
  </Section>  

  <Section title="Appearance">    
    <Control settingName="Title"/>
    <Control settingName="Style"/>
    <Style>
      <Margin />
    </Style>
  </Section>
  
  <Section title="Advanced" isCollapsible="true" isCollapsed="true">
     <UnencodedText>Use CSS to fine-tune appearance and behavior.
	&lt;a href=&quot;http://gethelp.wildapricot.com/articles/438/&quot; target=&quot;_blank&quot; &gt;Learn more&lt;/a&gt;
    </UnencodedText>
    <Control settingName="ClientId"/>
    <Control settingName="CustomClassName"/>
    <Control settingName="InlineStyle"/>
  </Section>
</SettingsLayout>